(6, 'New Post', 'new-post', '<h3 class=\"resTxt\" style=\"margin: 26px 0px 0px; padding: 0px; font-size: 1.6em; color: rgb(33, 150, 243); font-weight: bold; line-height: 1.4; font-family: Lato, sans-serif;\">\"Headlines are an essential component of your content\"</h3><h3 class=\"resTxt\" style=\"margin: 26px 0px 0px; padding: 0px; font-size: 1.6em; color: rgb(33, 150, 243); font-weight: bold; line-height: 1.4; font-family: Lato, sans-serif;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0px; text-align: justify; font-size: 0.89em; color: rgb(34, 34, 34); font-weight: 400;\">It is used every day in all types of businesses; Email newsletters, websites, print and online advertisements, presentations, social media updates, flyers, and brochures; the list goes on and on…</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0px; text-align: justify; font-size: 0.89em; color: rgb(34, 34, 34); font-weight: 400;\">David Ogilvy, the advertising legend once said that,&nbsp;<strong>On average, five times as many people read the headline as read the body copy. When you have written your headline, you have spent eighty cents out of your dollar.\"</strong>&nbsp;As Ogilvy points out, your headline is the first (and sometimes the only) thing that your audience will read</p></h3><h3 class=\"bluetitle removePandT s54\" style=\"margin: 1em 0px 0px; padding-top: 0px; padding-right: 0px; padding-left: 0px; color: rgb(33, 150, 243); font-size: 1.333em; font-family: Lato, sans-serif; padding-bottom: 0px !important; font-weight: 700 !important;\">Why Are Your Titles Important?</h3><h3 class=\"resTxt\" style=\"margin: 26px 0px 0px; padding: 0px; font-size: 1.6em; color: rgb(33, 150, 243); font-weight: bold; line-height: 1.4; font-family: Lato, sans-serif;\"><div style=\"color: rgb(34, 34, 34); font-size: 18px; font-weight: 400;\"><ul class=\"snippets\" style=\"list-style-image: url(&quot;../img/box1.jpg&quot;); padding: 1.3em 1.6em 1.3em 2.8em; margin: 1.8em 0px 0px; border: 2px solid rgb(33, 150, 243); border-radius: 4px;\"><li style=\"padding-bottom: 1.1em; padding-left: 1.1em;\">It is the&nbsp;<strong>first thing that grabs the attention</strong>&nbsp;of readers and helps build connections</li><li style=\"padding-bottom: 1.1em; padding-left: 1.1em;\">Attract readers towards&nbsp;<strong>wanting to continue reading</strong>&nbsp;the rest of your content</li><li style=\"padding-bottom: 1.1em; padding-left: 1.1em;\">Get attention in the&nbsp;<strong>search engine</strong>&nbsp;(SEO)</li><li style=\"padding-bottom: 1.1em; padding-left: 1.1em;\"><strong>First impression</strong>&nbsp;of your brand image</li><li style=\"padding-bottom: 0em; padding-left: 1.1em;\">A title changes the way readers read a content and&nbsp;<strong>the way they remember</strong>&nbsp;it</li></ul></div><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0px; text-align: justify; font-size: 0.89em; color: rgb(34, 34, 34); font-weight: 400;\">Now that you understand how important titles are, make sure you write only the great ones!</p></h3><h3 class=\"bluetitle removePandT s54\" style=\"margin: 1em 0px 0px; padding-top: 0px; padding-right: 0px; padding-left: 0px; color: rgb(33, 150, 243); font-size: 1.333em; font-family: Lato, sans-serif; padding-bottom: 0px !important; font-weight: 700 !important;\">Step 1: Generate Titles From Blog Title Generator</h3><h3 class=\"resTxt\" style=\"margin: 26px 0px 0px; padding: 0px; font-size: 1.6em; color: rgb(33, 150, 243); font-weight: bold; line-height: 1.4; font-family: Lato, sans-serif;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0px; text-align: justify; font-size: 0.89em; color: rgb(34, 34, 34); font-weight: 400;\">You just need to enter the keyword and select the keyword type to generate a list of 6 title ideas and suggestions. If you’re not satisfied with the results, you can&nbsp;<strong>always hit the refresh button</strong>&nbsp;to generate a new list of unique titles.</p></h3><h3 class=\"bluetitle removePandT s54\" style=\"margin: 1em 0px 0px; padding-top: 0px; padding-right: 0px; padding-left: 0px; color: rgb(33, 150, 243); font-size: 1.333em; font-family: Lato, sans-serif; padding-bottom: 0px !important; font-weight: 700 !important;\">Step 2: Find Titles That Are Relevant To Your Audiences’ Need</h3><h3 class=\"resTxt\" style=\"margin: 26px 0px 0px; padding: 0px; font-size: 1.6em; color: rgb(33, 150, 243); font-weight: bold; line-height: 1.4; font-family: Lato, sans-serif;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0px; text-align: justify; font-size: 0.89em; color: rgb(34, 34, 34); font-weight: 400;\">Given that you want an exhaustive list of all possible title ideas for your keyword, you certainly can!&nbsp;<strong>Save time by downloading ALL the titles.</strong>&nbsp;We’ll mail you everything we have in store for easier access.</p></h3><h3 class=\"bluetitle removePandT s54\" style=\"margin: 1em 0px 0px; padding-top: 0px; padding-right: 0px; padding-left: 0px; color: rgb(33, 150, 243); font-size: 1.333em; font-family: Lato, sans-serif; padding-bottom: 0px !important; font-weight: 700 !important;\">Step 3: Maximize Your Titles With The Right Content</h3><h3 class=\"resTxt\" style=\"margin: 26px 0px 0px; padding: 0px; font-size: 1.6em; color: rgb(33, 150, 243); font-weight: bold; line-height: 1.4; font-family: Lato, sans-serif;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0px; text-align: justify; font-size: 0.89em; color: rgb(34, 34, 34); font-weight: 400;\">Once you’ve gotten all the titles and have chosen the best one, the next thing you need to do is to craft a magnetic content.&nbsp;<strong>Great content marketers excel at creating content that their readers crave</strong>, but even the best struggle with delivering content to the right person at the right time.</p></h3><h3 class=\"bluetitle removePandT s54\" style=\"margin: 1em 0px 0px; padding-top: 0px; padding-right: 0px; padding-left: 0px; color: rgb(33, 150, 243); font-size: 1.333em; font-family: Lato, sans-serif; padding-bottom: 0px !important; font-weight: 700 !important;\">Step 4: Kickstart Your Content Journey</h3><h3 class=\"resTxt\" style=\"margin: 26px 0px 0px; padding: 0px; font-size: 1.6em; color: rgb(33, 150, 243); font-weight: bold; line-height: 1.4; font-family: Lato, sans-serif;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0.5em 0px 0px; text-align: justify; font-size: 0.89em; color: rgb(34, 34, 34); font-weight: 400;\">To make sure your content drives results, the&nbsp;<strong>format needs to be just as well-researched</strong>&nbsp;as the information contained in it.</p><p class=\"important-txt\" style=\"margin-right: auto; margin-bottom: 26px; margin-left: auto; padding: 0.5em 0px 0px; max-width: 670px; font-size: 0.89em; text-align: center !important;\">Bonus: Pro Tips On Winning Headlines</p><ul class=\"snippets\" style=\"list-style-image: url(&quot;../img/box1.jpg&quot;); padding: 1.3em 1.6em 1.3em 2.8em; margin: 1.8em 0px 0px; border: 2px solid rgb(33, 150, 243); border-radius: 4px; color: rgb(34, 34, 34); font-size: 18px; font-weight: 400;\"><li style=\"padding-bottom: 1.1em; padding-left: 1.1em;\">Let trending keywords drive you</li><li style=\"padding-bottom: 1.1em; padding-left: 1.1em;\">Show the benefit, not the feature</li><li style=\"padding-bottom: 1.1em; padding-left: 1.1em;\">Short and sweet is sometimes A-OK</li><li style=\"padding-bottom: 1.1em; padding-left: 1.1em;\">Place a number</li><li style=\"padding-bottom: 0em; padding-left: 1.1em;\">Don’t forget a call to action</li></ul><p style=\"padding-bottom: 0em; padding-left: 1.1em;\"><br></p><p style=\"padding-bottom: 0em; padding-left: 1.1em;\">Images<img src=\"https://neilpatel-qvjnwj7eutn3.netdna-ssl.com/wp-content/uploads/2017/08/blog.jpg\" style=\"width: 700px;\"></p><p style=\"padding-bottom: 0em; padding-left: 1.1em;\"><br></p><p style=\"padding-bottom: 0em; padding-left: 1.1em;\"><br></p><p style=\"padding-bottom: 0em; padding-left: 1.1em;\">Videos</p><p style=\"padding-bottom: 0em; padding-left: 1.1em;\"><br></p><p style=\"padding-bottom: 0em; padding-left: 1.1em;\"><iframe frameborder=\"0\" src=\"//www.youtube.com/embed/NjwUHXoi8lM\" width=\"640\" height=\"360\" class=\"note-video-clip\"></iframe></p><p style=\"padding-bottom: 0em; padding-left: 1.1em;\"><br></p></h3>', 4, 'uploads/posts/156527228510.jpg', '2019-09-03 07:18:13', '2019-08-07 13:46:38', '2019-09-03 07:18:13', 43);
INSERT INTO `posts` (`id`, `title`, `slug`, `content`, `category_id`, `featured`, `deleted_at`, `created_at`, `updated_at`, `user_id`) VALUES
(7, 'Front-end Frameworks', 'front-end-frameworks', '<h1 style=\"color: rgb(46, 50, 52); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px;\"><b><u>Front-end frameworks&nbsp;</u></b></h1><p style=\"color: rgb(46, 50, 52); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; font-weight: 400;\">usually consist of a package that is made up of other files and folders, such as HTML, CSS, JavasScript, etc. There are also many stand-alone frameworks out there. We are a big fan of Boostrap and the main KeyCDN website is built on it. A solid framework can be an essential tool for front-end developers.</p><ul style=\"color: rgb(46, 50, 52); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; font-weight: 400;\"><li><a href=\"http://getbootstrap.com/\" target=\"_blank\" rel=\"nofollow noopener\" style=\"color: rgb(4, 122, 237); outline: 0px; transition: color 0.3s ease-in-out 0s;\">Bootstrap</a>: HTML, CSS, and JS framework for developing responsive, mobile first projects on the web.</li><li><a href=\"http://foundation.zurb.com/\" target=\"_blank\" rel=\"nofollow noopener\" style=\"color: rgb(4, 122, 237); outline: 0px; transition: color 0.3s ease-in-out 0s;\">Foundation</a>: Family of responsive front-end frameworks that make it easy to design beautiful responsive websites, apps and emails that look amazing on any device.</li><li><a href=\"http://semantic-ui.com/\" target=\"_blank\" rel=\"nofollow noopener\" style=\"color: rgb(4, 122, 237); outline: 0px; transition: color 0.3s ease-in-out 0s;\">Semantic UI</a>: Development framework that helps create beautiful, responsive layouts using human-friendly HTML.</li><li><a href=\"http://getuikit.com/\" target=\"_blank\" rel=\"nofollow noopener\" style=\"color: rgb(4, 122, 237); outline: 0px; transition: color 0.3s ease-in-out 0s;\">uikit</a>: A lightweight and modular front-end framework for developing fast and powerful web interfaces.</li></ul><p style=\"color: rgb(46, 50, 52); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; font-weight: 400;\">To learn more about the differences between popular front-end framework, check out our list of the&nbsp;<a href=\"https://www.keycdn.com/blog/front-end-frameworks\" style=\"color: rgb(4, 122, 237); outline: 0px; transition: color 0.3s ease-in-out 0s;\">top front-end frameworks</a>&nbsp;of 2018.</p><p style=\"color: rgb(46, 50, 52); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; font-weight: 400;\"><img src=\"data:image/png;base64,\" data-filename=\"Capture.PNG\" style=\"width: 666px;\"><br></p>', 9, 'uploads/posts/1565261962Blog-5-trends-front-end-developer-new.jpg', '2019-09-03 07:18:19', '2019-08-08 10:59:22', '2019-09-03 07:18:19', 43);
INSERT INTO `posts` (`id`, `title`, `slug`, `content`, `category_id`, `featured`, `deleted_at`, `created_at`, `updated_at`, `user_id`) VALUES
(8, 'Languages / Platforms', 'languages-platforms', '<ul style=\"color: rgb(46, 50, 52); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px;\"><li><a href=\"http://php.net/\" target=\"_blank\" rel=\"nofollow noopener\" style=\"color: rgb(4, 122, 237); outline: 0px; transition: color 0.3s ease-in-out 0s;\">PHP</a>: Popular general-purpose scripting language that is especially suited to web development.</li><li><a href=\"https://nodejs.org/en/\" target=\"_blank\" rel=\"nofollow noopener\" style=\"color: rgb(4, 122, 237); outline: 0px; transition: color 0.3s ease-in-out 0s;\">NodeJS</a>: Event-driven I/O server-side JavaScript environment based on V8.</li><li><a href=\"https://en.wikipedia.org/wiki/JavaScript\" target=\"_blank\" rel=\"nofollow noopener\" style=\"color: rgb(4, 122, 237); outline: 0px; transition: color 0.3s ease-in-out 0s;\">JavaScript</a>: Programming language of HTML and the web.</li><li><a href=\"https://www.w3.org/TR/html5/\" target=\"_blank\" rel=\"nofollow noopener\" style=\"color: rgb(4, 122, 237); outline: 0px; transition: color 0.3s ease-in-out 0s;\">HTML5</a>: Markup language, the latest version of HTML and XHTML.</li><li><a href=\"https://www.python.org/\" target=\"_blank\" rel=\"nofollow noopener\" style=\"color: rgb(4, 122, 237); outline: 0px; transition: color 0.3s ease-in-out 0s;\">Python</a>: Programming language that lets you work quickly and integrate systems more effectively.</li><li><a href=\"https://www.ruby-lang.org/en/\" target=\"_blank\" rel=\"nofollow noopener\" style=\"color: rgb(4, 122, 237); outline: 0px; transition: color 0.3s ease-in-out 0s;\">Ruby</a>: A dynamic, open source programming language with a focus on simplicity and productivity.</li><li><a href=\"http://www.scala-lang.org/\" target=\"_blank\" rel=\"nofollow noopener\" style=\"color: rgb(4, 122, 237); outline: 0px; transition: color 0.3s ease-in-out 0s;\">Scala</a>: Scala is a pure-bred object-oriented language allowing a gradual, easy migration to a more functional style.</li><li><a href=\"https://developer.mozilla.org/en-US/docs/Web/CSS/CSS3\" target=\"_blank\" rel=\"nofollow noopener\" style=\"color: rgb(4, 122, 237); outline: 0px; transition: color 0.3s ease-in-out 0s;\">CSS3</a>: Latest version of cascading style sheets used in front-end development of sites and applications.</li><li><a href=\"https://en.wikipedia.org/wiki/SQL\" target=\"_blank\" rel=\"nofollow noopener\" style=\"color: rgb(4, 122, 237); outline: 0px; transition: color 0.3s ease-in-out 0s;\">SQL</a>: Stands for structured query language used with relational databases.</li><li><a href=\"https://golang.org/\" target=\"_blank\" rel=\"nofollow noopener\" style=\"color: rgb(4, 122, 237); outline: 0px; transition: color 0.3s ease-in-out 0s;\">Golang</a>: Open source programming language that makes it easy to build simple, reliable, and efficient software.</li><li><a href=\"https://www.rust-lang.org/\" target=\"_blank\" rel=\"nofollow noopener\" style=\"color: rgb(4, 122, 237); outline: 0px; transition: color 0.3s ease-in-out 0s;\">Rust</a>: Systems programming language that runs blazingly fast, prevents segfaults, and guarantees thread safety.</li><li><a href=\"http://elixir-lang.org/\" target=\"_blank\" rel=\"nofollow noopener\" style=\"color: rgb(4, 122, 237); outline: 0px; transition: color 0.3s ease-in-out 0s;\">Elixir</a>: Dynamic, functional language designed for building scalable and maintainable applications.</li><li><a href=\"https://www.typescriptlang.org/\" target=\"_blank\" rel=\"nofollow noopener\" style=\"color: rgb(4, 122, 237); outline: 0px; transition: color 0.3s ease-in-out 0s;\">TypeScript</a>: Open source programming language that is a superset of JavaScript which compiles to plain JavaScript.</li><li><img src=\"https://www.ars-network.com/wp-content/uploads/2018/12/web-development-1200x734.png\" style=\"width: 666px;\"><br></li></ul>', 13, 'uploads/posts/1565262575top-programming-languages-in-demand.jpg', NULL, '2019-08-08 11:09:35', '2019-08-08 11:11:41', 1),
(9, 'Database', 'database', '<p style=\"color: rgb(46, 50, 52); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; font-weight: 400;\">A&nbsp;<span style=\"font-weight: bolder;\">database</span>&nbsp;is a collection of information that is stored so that it can be retrieved, managed and updated.</p><ul style=\"color: rgb(46, 50, 52); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 16px; font-weight: 400;\"><li><a href=\"https://www.mysql.com/\" target=\"_blank\" rel=\"nofollow noopener\" style=\"color: rgb(4, 122, 237); outline: 0px; transition: color 0.3s ease-in-out 0s;\">MySQL</a>: One of the world’s most popular open source databases.</li><li><a href=\"https://mariadb.com/\" target=\"_blank\" rel=\"nofollow noopener\" style=\"color: rgb(4, 122, 237); outline: 0px; transition: color 0.3s ease-in-out 0s;\">MariaDB</a>: Made by the original developers of MySQL. MariaDB is also becoming very popular as an open source database server.</li><li><a href=\"https://www.mongodb.org/\" target=\"_blank\" rel=\"nofollow noopener\" style=\"color: rgb(4, 122, 237); outline: 0px; transition: color 0.3s ease-in-out 0s;\">MongoDB</a>: Next-generation database that lets you create applications never before possible.</li><li><a href=\"https://redis.io/\" target=\"_blank\" rel=\"nofollow noopener\" style=\"color: rgb(4, 122, 237); outline: 0px; transition: color 0.3s ease-in-out 0s;\">Redis</a>: An open source, in-memory data structure store, used as a database, cache and message broker.</li><li><a href=\"http://www.postgresql.org/\" target=\"_blank\" rel=\"nofollow noopener\" style=\"color: rgb(4, 122, 237); outline: 0px; transition: color 0.3s ease-in-out 0s;\">PostgreSQL</a>: A powerful, open source object-relational database system</li><li><img src=\"https://www.keycdn.com/img/blog/databases.webp\" style=\"width: 666px;\"><br></li></ul>', 13, 'uploads/posts/1565263403gdpr-compliance-mongodb-postgresql-distributed-sql-1.png', '2019-08-17 10:17:57', '2019-08-08 11:16:19', '2019-08-17 10:17:57', 1),
(11, 'The News International', 'the-news-international', '<h3><h2><h3><h4><h5><h1><ul><li style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 40px; padding: 0px;\">China supports Pakistan on Kashmir</li></ul></h1><ul><li style=\"margin: 20px 0px; line-height: 27px;\">BEIJING: China on Friday said the Kashmir issue was a dispute left from the colonial history and it should be properly and peacefully resolved based on the UN Charter, relevant United Nations Security Council resolutions and bilateral agreement, a statement issued by the Chinese Foreign Ministry said after a meeting between Foreign Minister Shah Mehmood Qureshi and his Chinese counterpart Wang Yi.</li></ul><ul><li style=\"margin: 20px 0px; line-height: 27px;\">Qureshi had an urgent meeting with Wang Yi here during which they discussed the illegal and unilateral actions taken by New Delhi in the Indian Held Kashmir (IHK). During the meeting, Wang Yi assured Qureshi that his country will continue to support Pakistan on safeguarding its legitimate rights and interests and uphold justice for Pakistan at the internal fora.</li></ul><ul><li style=\"margin: 20px 0px; line-height: 27px;\">He said China believed that unilateral actions that will complicate the situation should not be taken. He stressed that as all-weather strategic cooperative partners, China and Pakistan had understood and supported each other on issues concerning their respective core interests.</li></ul><ul><li style=\"margin: 20px 0px; line-height: 27px;\">Wang Yi called on both Pakistan and India to proceed from their national development and peace in South Asia, properly resolve historical grievances, get rid of zero-sum mindset, avoid unilateral action and seek a new path to peaceful coexistence.</li></ul><ul><li style=\"margin: 20px 0px; line-height: 27px;\">Later, talking to the media after his two and a half hours meeting with Wang Yi here, Foreign Minister Shah Mehmood Qureshi said China fully supported Pakistan\'s decision to go to the United Nations Security Council over Kashmir and assured it of complete cooperation in this regard. He said the Chinese side had agreed that steps taken by India were unilateral, changing the status quo and structure of Indian Held Kashmir.</li></ul><ul><li style=\"margin: 20px 0px; line-height: 27px;\">He said Wang Yi had also agreed that the Indian steps could jeopardise peace and stability in the region. The foreign minister said his Chinese counterpart was in concurrence that Jammu and Kashmir had been recognized as a disputed region and its resolution should also be in the light of the UN resolutions. He said the Chinese side had been informed that after lifting of curfew in the IHK, a new era of atrocities might start in the territory evoking reactions.</li></ul><ul><li style=\"margin: 20px 0px; line-height: 27px;\">Qureshi said Wang Yi met him on the instructions of President Xi Jinping becausethe nature of Pak-China relationship was different and the response level should also be different. Qureshi said he presented Pakistan\'s point of view on India\'s recent moves on the IHK adding that China had once again proved that it was an all-weather friend of Pakistan.</li></ul><ul><li style=\"margin: 20px 0px; line-height: 27px;\">Qureshi said he had told his Chinese counterpart that India might stage another Pulwama-like incident to divert attention from its illegal actions. Earlier on August 6, Chinese Foreign Ministry spokeswoman Hua Chunying told reporters that Beijing was “seriously concerned” about the rising tension in the region owing to the deployment of a large number of additional paramilitary troops in the Indian Held Kashmir and removal of its special status.</li></ul><ul><li style=\"margin: 20px 0px; line-height: 27px;\">\"China\'s position on the Kashmir issue is clear and consistent. It is also an international consensus that the Kashmir issue is an issue left from the past between India and Pakistan,\" she said.</li></ul><ul><li style=\"margin: 20px 0px; line-height: 27px;\">\"The relevant sides need to exercise restraint and act prudently. In particular, they should refrain from taking actions that will unilaterally change the status quo and escalate tensions.\" The spokesperson said that China called on both countries to peacefully resolve disputes \"through dialogue and consultation\" and to \"safeguard peace and stability in the region\"</li></ul><ul><li style=\"margin: 20px 0px; line-height: 27px;\"><img src=\"https://thethaiger.com/wp-content/uploads/2018/10/man-coffee-cup-pen-e1448908349513.jpg\" style=\"width: 666px;\"></li></ul></h5></h4></h3></h2></h3><ul><li style=\"margin: 20px 0px; font-size: 18px; line-height: 27px; font-family: Domine, serif; font-weight: 400; background-color: rgb(246, 246, 246);\">Coming Soon</li></ul>', 4, 'uploads/posts/15655292511200px-BBC_News.svg.png', NULL, '2019-08-10 11:25:41', '2019-08-11 13:14:11', 1),
(12, 'Github', 'github', '<p><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 14px; font-weight: 400;\">GitHub is an American company that provides hosting for software development version control using Git. It is a subsidiary of Microsoft, which acquired the company in 2018 for $7.5 billion.</span><br></p>', 6, 'uploads/posts/1565870201github-logo.png', NULL, '2019-08-15 11:56:41', '2019-08-15 11:56:41', 1),
(14, 'Welcome Our Page', 'welcome-our-page', 'On your homepage, you need to make it obvious to your homepage visitors:-\r\n\r\nWhat your website offers them\r\nWhat they can find and achieve on your website\r\nYou can achieve this in a number of ways:-\r\n\r\nIf it is not immediately obvious to your visitors what your website is about, you are going to need to write a welcome message which makes the purpose of your website clear.\r\nIf your website is simple, it may not be necessary to write a welcome message.  You may be able to display some sample previews of your content which, in combination with your menu, will make it obvious to your visitors what they can find on your website.\r\nThe modern trend is towards the second option – with no formal welcome message or statement of purpose. However, when a site is complex, it becomes essential to explain to your users, in as few simple words as possible, what they can find on your site and how they can get started.\r\n\r\nThe key to writing a good welcome message is to make it focused around your users’ wants and needs, and make it extremely simple.', 9, 'uploads/posts/1566037001welcome-to-our-page-1-728.jpg', '2019-09-03 06:03:15', '2019-08-17 10:01:36', '2019-09-03 06:03:15', 51);

